	<section class="article-content clearfix">
		<p>Arlington VA</p>
<p><em>April 2017 - Present </em>(Contract to Hire)</p>
<p>Senior Drupal Developer</p>
<p>Description: Evolent Health is comprised of an experienced and committed group of health care professionals, unified by a passion for transforming the way health care is delivered and experienced in America.</p>
<p>Completed Projects Include: </p>
<ul>
<li>Working as a full time full stack web developer dealing with various technologies and learning something new everyday.</li>
<li>Multiple components updates on Prism style guide</li>
<li>Updated Prism releases and repository.</li>
<li>Worked on Drupal community portal multi tenancy.</li>
<li>Worked on jobvite framework update on the evolenthealth drupal portal.</li>
<li>Updated the microsites with the latest SBC for premiere health docs.</li>
<li>Updated the identify application UI with the new prism changes.</li>
<li>Took ownership of multiple drupal and non drupal web applications for development and administration.</li>
<li>Migrated multiple client sites built on various CMS from Hostgator to Azure.</li>
<li>Setup CI/CD using VSTS on Azure IaaS architecture.</li>
<li>Worked on OpenID connect module integration with the custom IDP solution.</li>
<li>Used various API to get client details and integrate with Drupal Organic Groups.</li>
<li>I was the subject matter expert (SME) for Drupal and Client focused websites at Evolent Health</li>
<li>We managed the project in a Agile fashion and had daily scrums with the team.</li>
<li>Worked in a small team environment and was self motivated and working on constantly improving the manageability of the many client sites.</li>
<li>Worked with bigger teams from other projects as a front end web developer by learning Angular JS and React.</li>
<li>Worked with Elastic Search, MS SQL server and C#.net for the backend application development.</li>
<li>Wrote shell scripts to rsync files between multiple servers.</li>
<li>Used monit and zabbix to monitor and autorestart services running on servers to avoid downtime on servers.</li>
</ul>
<p> </p>
